import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';
import Home from "./Home";
import Navbar from './Navbar';
import SeekerRegister from "./SeekerRegister";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <Home/>
        <SeekerRegister/>
      </div>
    </div>
  );
}

export default App;
